function MatchesList() {
  const dummyMatches = Array.from({ length: 6 }, (_, i) => ({
    company: `Company ${i + 1}`,
    sector: "IT",
    location: "India",
  }));

  return (
    <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
      {dummyMatches.map((match, idx) => (
        <div key={idx} className="bg-white shadow rounded-lg p-4">
          <h3 className="font-bold text-gray-800">{match.company}</h3>
          <p className="text-gray-600">Sector: {match.sector}</p>
          <p className="text-gray-600">Location: {match.location}</p>
          <button className="mt-2 px-4 py-2 bg-blue-600 text-white rounded hover:bg-blue-700">
            View Details
          </button>
        </div>
      ))}
    </div>
  );
}

export default MatchesList;
